import React from "react";
import { Button, ButtonToolbar, ButtonGroup } from "react-bootstrap";
import "./loginButton.css";

function App() {
  return (
    <ButtonToolbar>
      <ButtonGroup className="mr-2" aria-label="First group">
        <Button variant="info" className="loginBut" />
      </ButtonGroup>
    </ButtonToolbar>
  );
}

export default App;
